(1, 'nike-brand-running', 'Nike', 'Just do It', 'Nike_1639584681.png', '<h2>Nike Running</h2>\r\n\r\n<h2>Origins and history</h2>\r\n\r\n<p>Nike, originally known as Blue Ribbon Sports (BRS), was founded by <a href=\"https://en.wikipedia.org/wiki/University_of_Oregon\">University of Oregon</a> track athlete <a href=\"https://en.wikipedia.org/wiki/Phil_Knight\">Phil Knight</a> and his coach, <a href=\"https://en.wikipedia.org/wiki/Bill_Bowerman\">Bill Bowerman</a>, on January 25, 1964.<a href=\"https://en.wikipedia.org/wiki/Nike,_Inc.#cite_note-:8-13\">[12]</a> The company initially operated in <a href=\"https://en.wikipedia.org/wiki/Eugene,_Oregon\">Eugene</a>, Oregon as a distributor for Japanese shoe maker <a href=\"https://en.wikipedia.org/wiki/Onitsuka_Tiger\">Onitsuka Tiger</a>, making most sales at track meets out of Knight&#39;s automobile.<a href=\"https://en.wikipedia.org/wiki/Nike,_Inc.#cite_note-:8-13\">[12]</a></p>\r\n\r\n<p>According to <a href=\"https://en.wikipedia.org/wiki/Otis_Davis\">Otis Davis</a>, a University of Oregon student-athlete coached by Bowerman and Olympic gold medalist at the <a href=\"https://en.wikipedia.org/wiki/1960_Summer_Olympics\">1960 Summer Olympics</a>, his coach made the first pair of Nike shoes for him, contradicting a claim that they were made for Phil Knight. According to Davis, &quot;I told <a href=\"https://en.wikipedia.org/wiki/Tom_Brokaw\">Tom Brokaw</a> that I was the first. I don&#39;t care what all the billionaires say. Bill Bowerman made the first pair of shoes for me. People don&#39;t believe me. In fact, I didn&#39;t like the way they felt on my feet. There was no support and they were too tight. But I saw Bowerman made them from the <a href=\"https://en.wikipedia.org/wiki/Waffle_iron\">waffle iron</a>, and they were mine&quot;.<a href=\"https://en.wikipedia.org/wiki/Nike,_Inc.#cite_note-HudReporter2006-14\">[13]</a></p>\r\n\r\n<p>In its first year in business, BRS sold 1,300 pairs of Japanese running shoes grossing $8,000.<a href=\"https://en.wikipedia.org/wiki/Nike,_Inc.#cite_note-15\">[14]</a> By 1965, sales had reached $20,000. In 1966, BRS opened its first retail store at 3107 Pico Boulevard in <a href=\"https://en.wikipedia.org/wiki/Santa_Monica,_California\">Santa Monica, California</a>. In 1967, due to increasing sales, BRS expanded retail and distribution operations on the East Coast, in <a href=\"https://en.wikipedia.org/wiki/Wellesley,_Massachusetts\">Wellesley, Massachusetts</a>.<a href=\"https://en.wikipedia.org/wiki/Nike,_Inc.#cite_note-16\">[15]</a></p>\r\n\r\n<h3>Nike Vaporfly Shoe</h3>\r\n\r\n<p>On January 31, 2020, the <a href=\"https://en.wikipedia.org/wiki/World_Athletics\">World Athletics</a> issued new guidelines concerning shoes to be used in the upcoming <a href=\"https://en.wikipedia.org/wiki/2020_Summer_Olympics\">Tokyo 2020 Olympics</a>.<a href=\"https://en.wikipedia.org/wiki/Nike,_Inc.#cite_note-:12-128\">[126]</a> These updates came in response to criticisms concerning technology in the Nike Vaporfly running shoes, which had been submitted beginning around 2017&ndash;2018.<a href=\"https://en.wikipedia.org/wiki/Nike,_Inc.#cite_note-:2-129\">[127]</a> These criticisms stated that the shoes provided athletes with an unfair advantage over their opponents and some critics considered it to be a form of <a href=\"https://en.wikipedia.org/wiki/Technology_doping\">technology doping</a>.<a href=\"https://en.wikipedia.org/wiki/Nike,_Inc.#cite_note-:03-62\">[60]</a><a href=\"https://en.wikipedia.org/wiki/Nike,_Inc.#cite_note-:3-130\">[128]</a>.</p>\r\n\r\n<p>According to Nike funded research, the shoes can improve efficiency by up to 4.2%<a href=\"https://en.wikipedia.org/wiki/Nike,_Inc.#cite_note-:03-62\">[60]</a> and runners who have tested the shoe are saying that it causes reduced soreness in the legs; sports technologist Bryce Dyer attributes this to the ZoomX and carbon fiber plate since it absorbs the energy and &quot;spring[s] runners forward&quot;.<a href=\"https://en.wikipedia.org/wiki/Nike,_Inc.#cite_note-:3-130\">[128]</a> Some athletes, scientists, and fans have compared this to the 2008 <a href=\"https://en.wikipedia.org/wiki/LZR_Racer\">LAZR swimsuit controversy</a>.<a href=\"https://en.wikipedia.org/wiki/Nike,_Inc.#cite_note-131\">[129]</a></p>\r\n\r\n<p>Some of the major changes in the guidelines that have come about as a result of these criticisms include that the &quot;sole must be no thicker than 40mm&quot; and that &quot;the shoe must not contain more than one rigid embedded plate or blade (of any material) that runs either the full length or only part of the length of the shoe. The plate may be in more than one part but those parts must be located sequentially in one plane (not stacked or in parallel) and must not overlap&quot;. The components of the shoes are not the only thing that had major changes; starting April 30, 2020, &quot;any shoe must have been available for purchase by any athlete on the open retail market (online or in store) for a period of four months before it can be used in competition&quot;.<a href=\"https://en.wikipedia.org/wiki/Nike,_Inc.#cite_note-:12-128\">[126]</a> Prior to these new guidelines World Athletics reviewed the Vaporfly shoes and &quot;concluded that there is independent research that indicates that the new technology incorporated in the soles of road and spiked shoes may provide a performance advantage&quot; and that it recommends further research to &quot;establish the true impact of [the Vaporfly] technology.&quot;<a href=\"https://en.wikipedia.org/wiki/Nike,_Inc.#cite_note-:12-128\">[126]</a></p>', 10, 1, 0, 'Nike', 'Nike running, best shoes for every age', 'nike, running shoes, best shoes, beautiful shoes', '2021-12-08 12:16:32', '2021-12-21 06:17:12'),
(2, 'asics_i2Rk', 'Asics', 'Sound mind in a sound body', 'Asics_1639671945.jpg', '<h2>Asics -&nbsp;<strong>anima sana in corpore sano</strong></h2>\r\n\r\n<p>Asics (アシックス, Ashikkusu) is a Japanese multinational corporation which produces sports equipment designed for a wide range of sports. The name is an acronym for the <strong>Latin phrase anima sana in corpore sano</strong>, which translates as &quot;Sound mind in a sound body&quot;.</p>\r\n\r\n<p>Asics is a well known provider of <strong>running shoes</strong>, although they do make regular style shoes as well. Not only is Asics known for their running shoes but the quality, style, price and durability of each running shoe as well.</p>\r\n\r\n<p>Our medium-term company strategy VISION2030 lays out our long-term mission, to Create Quality Lifestyles through Intelligent Sports Technology, and our goal based on this is to ensure a world in which each and every one of us can engage in exercise and sports throughout our lives and continue to live in good health, both mentally and physically.</p>\r\n\r\n<p>We have all grown increasingly conscious of both physical and emotional health amidst this unprecedented global pandemic. Moreover, advances with digital technology now allow us to engage in sports in new, more varied ways. We know that our founding philosophy as well as our brand slogan of Sound Mind, Sound Body are more important than ever in realizing a society in which the joy of all types of sports can be shared for more fulfilling lifestyles for the people of the world.</p>\r\n\r\n<blockquote>\r\n<p>We endeavor to continue to utilize the intelligent sports technology we have developed over years and continue to offer environmentally friendly and sustainable goods and services that will be both enjoyed and trusted by all sports lovers and ASICS stakeholders.</p>\r\n</blockquote>', 30, 1, 0, 'Asics Running', 'Asics runnning equipment, best quality for sport', 'asics maraton, shoes runnning, quality equipment, japanese equipment', '2021-12-08 12:16:32', '2021-12-17 13:43:00'),
(3, 'new-balance_ltAL', 'New Balance', 'Fearlessly Independent Since 1906', 'NewBalance_1639585693.jpg', '<h2>New Balance - NB</h2>\r\n\r\n<p><strong>New Balance</strong> (<strong>NB</strong>) is an American sports footwear and apparel brand that was established in 1906. The brand was originally associated with the <strong>New Balance Arch Support Company</strong>. Today the brand is associated with <strong>New Balance Athletics, Inc.</strong>, an American <a href=\"https://en.wikipedia.org/wiki/Multinational_corporation\">multinational corporation</a> and its parent <strong>New Balance, Inc.</strong>, a <a href=\"https://en.wikipedia.org/wiki/Jim_Davis_(businessman)\">Jim Davis</a> owned holding company that owns New Balance Athletics, Inc. New Balance Athletics, Inc. and New Balance, Inc. are both based in the same headquarters located in <a href=\"https://en.wikipedia.org/wiki/Boston,_Massachusetts\">Boston, Massachusetts</a>.</p>\r\n\r\n<p>n February 2015, the company announced its entry into the global <a href=\"https://en.wikipedia.org/wiki/Association_football\">soccer</a> (association football) market. New Balance had started its soccer business through its subsidiary <a href=\"https://en.wikipedia.org/wiki/Warrior_Sports\">Warrior Sports</a> in 2012, punctuated by a $40-million-a-year sponsorship deal with <a href=\"https://en.wikipedia.org/wiki/Liverpool_F.C.\">Liverpool</a>, but made the move to rebrand based on the global reach of the parent brand.<a href=\"https://en.wikipedia.org/wiki/New_Balance#cite_note-9\">[9]</a> Later on, the <a href=\"https://en.wikipedia.org/wiki/UK_High_Court\">UK High Court</a> rejected the legal filling of New Balance against the Liverpool&#39;s UK&pound;70 million+ kit deal with <a href=\"https://en.wikipedia.org/wiki/Nike,_Inc.\">Nike</a>, which come into force in January 2020 and staggered the Manchester United deal with Adidas for &pound;75 million annually.<a href=\"https://en.wikipedia.org/wiki/New_Balance#cite_note-10\">[10]</a><a href=\"https://en.wikipedia.org/wiki/New_Balance#cite_note-11\">[11]</a></p>\r\n\r\n<p>During 2016, New Balance opposed the <a href=\"https://en.wikipedia.org/wiki/Trans_Pacific_Partnership\">Trans Pacific Partnership</a><a href=\"https://en.wikipedia.org/wiki/New_Balance#cite_note-12\">[12]</a><a href=\"https://en.wikipedia.org/wiki/New_Balance#cite_note-13\">[13]</a><a href=\"https://en.wikipedia.org/wiki/New_Balance#cite_note-14\">[14]</a> and condemned the Obama administration&#39;s support for it, arguing that it would hurt their domestic shoe manufacturing (while Nike, which does not manufacture in the US, supported the TPP).<a href=\"https://en.wikipedia.org/wiki/New_Balance#cite_note-15\">[15]</a><a href=\"https://en.wikipedia.org/wiki/New_Balance#cite_note-16\">[16]</a> Matt Lebretton, the company&#39;s Vice President of public affairs said in April 2016 &quot;I would say that when Hillary Clinton, Bernie Sanders and Donald Trump all agree on something, then it has to be given a closer look; and they all agree that TPP is not the right policy.&quot; After Donald Trump won the 2016 U.S. presidential election, Lebretton told a reporter, &quot;The Obama administration turned a deaf ear to us [about trade] and frankly, with President-elect Trump, we feel things are going to move in the right direction.&quot; Some news outlets reported that an ad hoc boycott campaign was created out of an interpretation of Lebretton&#39;s remarks as supportive of Trump.<a href=\"https://en.wikipedia.org/wiki/New_Balance#cite_note-17\">[17]</a><a href=\"https://en.wikipedia.org/wiki/New_Balance#cite_note-18\">[18]</a><a href=\"https://en.wikipedia.org/wiki/New_Balance#cite_note-19\">[19]</a><a href=\"https://en.wikipedia.org/wiki/New_Balance#cite_note-20\">[20]</a> Owner and Chairman <a href=\"https://en.wikipedia.org/wiki/Jim_Davis_(businessman)\">Davis</a> donated almost $400,000 to the <a href=\"https://en.wikipedia.org/wiki/Trump_Victory_Committee\">Trump Victory Committee</a> in September 2016.<a href=\"https://en.wikipedia.org/wiki/New_Balance#cite_note-21\">[21]</a></p>\r\n\r\n<h3>Inside New Balance</h3>\r\n\r\n<p>We stand for something bigger than sneakers. We champion those who are fearlessly driven by their passions. We elevate sport. We do right by people and the planet. Together, we drive meaningful change in communities around the world.</p>\r\n\r\n<h2>Our goal is to help you achieve yours.</h2>\r\n\r\n<p>﻿At New Balance, our job is to aid athletes in their pursuits, whether that means helping professional athletes set records and win medals, or propelling everyday athletes to achieve a new PR, run their first 5K or just to live a more healthy and active lifestyle.</p>\r\n\r\n<p>Our products are the perfect blend of function and fashion, giving you the performance technology you need and the style you want. Our associates around the world bring these goals to life with their high-level skills and creativity. While we offer the best product on the market, we&rsquo;re also equally committed to giving back. So while we look to succeed, we believe in ensuring others have the same opportunity.</p>\r\n\r\n<p>&nbsp;</p>', 40, 1, 0, 'New Balance Running', 'New Balance Running shoes', 'best shoes, running new balance, all sports equipment', '2021-12-08 12:16:32', '2021-12-15 14:28:13'),
(4, 'brooks_UFjx', 'Brooks', 'Run happy', 'Brooks_1639586163.png', '<h2>Brooks - Run happy!</h2>\r\n\r\n<p>Brooks Sports, Inc., also known as Brooks Running, is <strong>an American sports equipment company</strong> that designs and markets high-performance men&#39;s and women&#39;s sneakers, clothing, and accessories. Headquartered in Seattle, Washington, Brooks products are available in 60 countries worldwide.</p>\r\n\r\n<h2>Miles away from your average workplace.</h2>\r\n\r\n<p>Running is more than just a hobby&mdash;it&rsquo;s our passion. We eat, breathe and stretch for the run. And we find running brings us closer together as a group than any team-building exercise could. On the road of life, it&rsquo;s always better to travel in packs.</p>\r\n\r\n<h2>Where you can find us between runs</h2>\r\n\r\n<p>Brooks global headquarters is located in the heart of Seattle, right along the Burke-Gilman running and biking trail next to Lake Union. If you ever visit us, poke your head into the <a href=\"https://www.brooksrunning.com/en_us/brooks-trailhead/\">Brooks Trailhead</a>, our one and only flagship retail store. We&#39;re proud to have a LEED certification and a history of surpassing our target energy and water goals. Even our building inspires happy running and green living.</p>\r\n\r\n<p>We&rsquo;re a subsidiary of Berkshire Hathaway, one of the top ten largest public companies in the world.</p>\r\n\r\n<h2>We do some serious globe-trotting</h2>\r\n\r\n<p>Our second home is Olympisch Stadion (yes, we know Dutch) in Amsterdam, home of the 1928 Summer Olympics. Its location is key, because our gear is enjoyed by runners in over 50 countries worldwide. So wherever you are when you need running gear, accept no substitutes.</p>', 60, 1, 0, 'Brooks running shoes', 'Running shoes from brooks for speed and endurance', 'books, running shoes for marathon, running shoes for speed', '2021-12-08 12:16:32', '2021-12-15 14:36:03'),
(5, 'saucony-aypi_nREI', 'Saucony', 'Maybe strong is just what you have left', 'Saucony_1639672212.png', '<h1>Saucony</h1>\r\n\r\n<p><strong>Saucony</strong> <a href=\"https://en.wikipedia.org/wiki/Help:IPA/English\">/ˈsɔːkəni/</a> is an American brand of <a href=\"https://en.wikipedia.org/wiki/Athletic_footwear\">athletic footwear</a> and <a href=\"https://en.wikipedia.org/wiki/Clothing\">apparel</a>. Founded in 1898, the company is owned by <a href=\"https://en.wikipedia.org/wiki/Wolverine_World_Wide\">Wolverine World Wide</a>.<a href=\"https://en.wikipedia.org/wiki/Saucony#cite_note-1\">[1]</a> Products commercialised by Saucony include footwear and clothing ranges, such as <a href=\"https://en.wikipedia.org/wiki/Sneakers\">athletic shoes</a>, <a href=\"https://en.wikipedia.org/wiki/Jacket\">jackets</a>, <a href=\"https://en.wikipedia.org/wiki/Hoodie\">hoodies</a>, <a href=\"https://en.wikipedia.org/wiki/T-shirt\">t-shirts</a>, <a href=\"https://en.wikipedia.org/wiki/Sweatpant\">sweatpants</a>, <a href=\"https://en.wikipedia.org/wiki/Shorts\">shorts</a>, and <a href=\"https://en.wikipedia.org/wiki/Sock\">socks</a>. Accessories include <a href=\"https://en.wikipedia.org/wiki/Hat\">hats</a> and <a href=\"https://en.wikipedia.org/wiki/Backpack\">backpacks</a>.<a href=\"https://en.wikipedia.org/wiki/Saucony#cite_note-2\">[2]</a></p>\r\n\r\n<h2>Footwear</h2>\r\n\r\n<p>The company offers a variety of shoes, such as <a href=\"https://en.wikipedia.org/wiki/Running_shoes\">running</a>, trail running, racing, walking, and a college collection. Each of these types of shoes utilizes specific technology relevant to the type of targeted activity. The shoes are designed for 3 main purposes: racing, running, and walking. Shoes are also made by focusing on the runner&#39;s foot size, type of running, arch type, <a href=\"https://en.wikipedia.org/wiki/Pronation\">pronation</a>, and running location.</p>\r\n\r\n<p>On April 3, 2018, Saucony teamed up with the Massachusetts-based doughnut and coffee company, <a href=\"https://en.wikipedia.org/wiki/Dunkin%27_Donuts\">Dunkin&#39; Donuts</a> to produce a strawberry-frosted donut themed running shoe to commemorate the 122nd running of the <a href=\"https://en.wikipedia.org/wiki/Boston_Marathon\">Boston Marathon</a>. The Saucony X Dunkin&rsquo; Kinvara 9 comes in a donut box and the heel of the shoe is covered in rainbow <a href=\"https://en.wikipedia.org/wiki/Sprinkles\">sprinkles</a>.<a href=\"https://en.wikipedia.org/wiki/Saucony#cite_note-10\">[10]</a> The company again released a Dunkin&#39; themed running shoe in March 2019 on the successor to the Kinvara 9, the Kinvara 10.<a href=\"https://en.wikipedia.org/wiki/Saucony#cite_note-11\">[11]</a></p>\r\n\r\n<p>&nbsp;</p>', 50, 1, 0, 'Saucony Running', 'Saucony running shoes for marathon and super long distances', 'saucony sport shoes, marathon best shoes, beutiful csual', '2021-12-08 12:16:32', '2021-12-17 15:03:58'),
(6, 'hoka-one-one-jtcf-5nsi_HEjQ', 'Hoka one one', 'Time to fly', 'Hokaoneone_1639586584.png', '<h2>Hoka one-one Time to fly!</h2>\r\n\r\n<p>Hoka shoes have a <strong>cushioned midsole that offers shock absorbency and added comfort to help protect your joints</strong>. Meta-Rocker. The Meta-Rocker technology uses a low heel-to-toe drop &mdash; meaning the height difference between the heel and the ball of the feet is minimal &mdash; plus a rounded sole to help propel you forward.</p>\r\n\r\n<p>Founded in 2009 by French trail runners Nicolas Mermoud and Jean-Luc Diard, Hoka began just as the <a href=\"https://www.runnersworld.com/gear/a22144396/best-minimalist-running-shoes/\">minimalist shoe</a> movement was reaching its peak. In spite (or because) of that trend, Hoka shoes offered the antithesis to those barefoot models: maximalist cushioning that cradled runners&rsquo; feet. Inspired by the smooth ride of mountain bikes and powder skis, Mermoud and Diard wanted to bring a similar &ldquo;floating feel&rdquo; to running. They initially made prototypes themselves and worked with a chemist at a Chinese shoe company to develop an entirely new kind of EVA foam that was soft and surprisingly lightweight&mdash;characteristics that are now hallmarks of Hoka kicks.</p>\r\n\r\n<h2>The Hoka Recipe</h2>\r\n\r\n<p>Mermoud and Diard developed their shoes around a few basic principles: adding more cushioning, using light materials, and creating a wide rocker midsole to preserve momentum and create a smoother ride. The shoes were initially marketed to trail runners, but the brand now makes road shoes and even <a href=\"https://www.runnersworld.com/gear/a20745510/best-running-track-spikes-reviewed/\">track spikes</a>. Although some companies have forsaken EVA foam entirely in favor of newer formulations, Hoka has stuck with its proprietary EVA-rubber blend. Our results from the RW Shoe Lab confirm that it&rsquo;s more elastic (for better support and energy return) and more durable than traditional EVA. Hoka&rsquo;s foam has gone by different names over the years, including RMAT and R-Bound, but its underlying chemistry is essentially the same.</p>', 80, 1, 0, 'Hoka running', 'hoka one one best foam for marathon running', 'the best protective shoes for running from hoka one one', '2021-12-08 12:16:32', '2021-12-18 14:05:26'),
(7, 'scheckers_jcKw', 'Scheckers', 'Get back in the game', 'Scheckers_1639586467.png', '<h1>Skechers</h1>\r\n\r\n<p><strong>kechers USA, Inc.</strong> is an <a href=\"https://en.wikipedia.org/wiki/USA\">American</a> footwear company. Headquartered in <a href=\"https://en.wikipedia.org/wiki/Manhattan_Beach,_California\">Manhattan Beach</a>, <a href=\"https://en.wikipedia.org/wiki/California\">California</a>, the brand was founded in 1992 and is now the third largest athletic footwear brand in the United States.</p>\r\n\r\n<p>Skechers was founded in 1992 by Robert Greenberg, who had previously founded <a href=\"https://en.wikipedia.org/wiki/LA_Gear\">L.A. Gear</a> in 1978 (he stepped down as CEO of that company the same year he founded Skechers).<a href=\"https://en.wikipedia.org/wiki/Skechers#cite_note-4\">[4]</a><a href=\"https://en.wikipedia.org/wiki/Skechers#cite_note-5\">[5]</a><a href=\"https://en.wikipedia.org/wiki/Skechers#cite_note-:0-6\">[6]</a> Greenberg sought to focus on the casual footwear market. Skechers&#39; early products were utility-style <a href=\"https://en.wikipedia.org/wiki/Boot\">boots</a> and <a href=\"https://en.wikipedia.org/wiki/Skate_shoes\">skate shoes</a>.<a href=\"https://en.wikipedia.org/wiki/Skechers#cite_note-:0-6\">[6]</a> The company has since diversified to include <a href=\"https://en.wikipedia.org/wiki/Athletic_shoe\">athletic</a> and <a href=\"https://en.wikipedia.org/wiki/Sneakers_(footwear)\">casual</a> styles for men, women, and children,<a href=\"https://en.wikipedia.org/wiki/Skechers#cite_note-7\">[7]</a> as well as performance shoes.<a href=\"https://en.wikipedia.org/wiki/Skechers#cite_note-CorporateInfo-2\">[2]</a> In Jan, 2019, the company started an expansion of its corporate headquarter to double the company&#39;s office, design and showroom space in the South Bay.<a href=\"https://en.wikipedia.org/wiki/Skechers#cite_note-8\">[8]</a></p>\r\n\r\n<h3>Litigation</h3>\r\n\r\n<p>In 2012, Skechers agreed to settle a <a href=\"https://en.wikipedia.org/wiki/Class_action\">class action</a> lawsuit for $40 million based on a U.S. <a href=\"https://en.wikipedia.org/wiki/Federal_Trade_Commission\">Federal Trade Commission</a> complaint that it had misled customers with its <a href=\"https://en.wikipedia.org/wiki/Rocker_bottom_shoe\">Shape-Ups</a> ads.<a href=\"https://en.wikipedia.org/wiki/Skechers#cite_note-9\">[9]</a> In 2019, <a href=\"https://en.wikipedia.org/wiki/Nike,_Inc.\">Nike</a> filed a <a href=\"https://en.wikipedia.org/wiki/Patent_infringement\">patent infringement</a> lawsuit against Skechers because, according to Nike, Skechers had infringed on the design of their <a href=\"https://en.wikipedia.org/wiki/Nike_Air_Max\">VaporMax</a> and <a href=\"https://en.wikipedia.org/wiki/Nike_Air_Max\">Air Max 270</a> sneakers.<a href=\"https://en.wikipedia.org/wiki/Skechers#cite_note-10\">[10]</a></p>\r\n\r\n<h3>Forced labor investigation</h3>\r\n\r\n<p>In 2021, French prosecutors launched an investigation into whether Skechers and other brands had concealed or profited from forced <a href=\"https://en.wikipedia.org/wiki/Uyghurs\">Uyghur</a> labor.<a href=\"https://en.wikipedia.org/wiki/Skechers#cite_note-11\">[11]</a><a href=\"https://en.wikipedia.org/wiki/Skechers#cite_note-12\">[12]</a> The investigation resulted that there is no concrete evidence on forced labour taking place.</p>\r\n\r\n<h2>Products and advertising</h2>\r\n\r\n<p>The company offers two footwear categories: a <a href=\"https://en.wikipedia.org/wiki/Lifestyle_brand\">lifestyle division</a> that includes Skechers Memory Foam, the charity line BOBS and Relaxed Fit comfort shoes, and a <a href=\"https://en.wikipedia.org/wiki/Sportswear_(activewear)\">performance division</a> that includes Skechers GOrun and Skechers GOwalk footwear. Through licensing agreements, the company offers branded bags, watches, eyewear and additional merchandise.<a href=\"https://en.wikipedia.org/wiki/Skechers#cite_note-CorporateInfo-2\">[2]</a> Since 2020, select shoes have utilized <a href=\"https://en.wikipedia.org/wiki/Goodyear_Tire_and_Rubber_Company\">Goodyear</a> rubber.<a href=\"https://en.wikipedia.org/wiki/Skechers#cite_note-13\">[13]</a></p>\r\n\r\n<p>Skechers has promoted its products with celebrities including recording artists <a href=\"https://en.wikipedia.org/wiki/Demi_Lovato\">Demi Lovato</a><a href=\"https://en.wikipedia.org/wiki/Skechers#cite_note-14\">[14]</a> and <a href=\"https://en.wikipedia.org/wiki/Camila_Cabello\">Camila Cabello</a>,<a href=\"https://en.wikipedia.org/wiki/Skechers#cite_note-15\">[15]</a> baseball players <a href=\"https://en.wikipedia.org/wiki/Clayton_Kershaw\">Clayton Kershaw</a>,<a href=\"https://en.wikipedia.org/wiki/Skechers#cite_note-16\">[16]</a> <a href=\"https://en.wikipedia.org/wiki/David_Ortiz\">David Ortiz</a>,<a href=\"https://en.wikipedia.org/wiki/Skechers#cite_note-17\">[17]</a> and football players <a href=\"https://en.wikipedia.org/wiki/Tony_Romo\">Tony Romo</a> and <a href=\"https://en.wikipedia.org/wiki/Howie_Long\">Howie Long</a>.<a href=\"https://en.wikipedia.org/wiki/Skechers#cite_note-18\">[18]</a><a href=\"https://en.wikipedia.org/wiki/Skechers#cite_note-19\">[19]</a> The Skechers Performance Division has featured elite runner <a href=\"https://en.wikipedia.org/wiki/Meb_Keflezighi\">Meb Keflezighi</a>,<a href=\"https://en.wikipedia.org/wiki/Skechers#cite_note-20\">[20]</a> and pro golfers <a href=\"https://en.wikipedia.org/wiki/Matt_Kuchar\">Matt Kuchar</a>, <a href=\"https://en.wikipedia.org/wiki/Brooke_Henderson\">Brooke Henderson</a>, and <a href=\"https://en.wikipedia.org/wiki/Wesley_Bryan\">Wesley Bryan</a>.<a href=\"https://en.wikipedia.org/wiki/Skechers#cite_note-CorporateInfo-2\">[2]</a><a href=\"https://en.wikipedia.org/wiki/Skechers#cite_note-21\">[21]</a> In 2014, Skechers signed an endorsement deal with musician <a href=\"https://en.wikipedia.org/wiki/Ringo_Starr\">Ringo Starr</a>.<a href=\"https://en.wikipedia.org/wiki/Skechers#cite_note-22\">[22]</a><a href=\"https://en.wikipedia.org/wiki/Skechers#cite_note-23\">[23]</a></p>\r\n\r\n<p>On March 1, 2019, Skechers launched a print and digital <a href=\"https://en.wikipedia.org/wiki/Comparative_advertising\">comparative advertising</a> campaign titled &quot;Just Blew It&quot; to highlight the <a href=\"https://en.wikipedia.org/wiki/Zion_Williamson\">Zion Williamson</a> failed shoe incident with rival <a href=\"https://en.wikipedia.org/wiki/Nike,_Inc.\">Nike</a>.<a href=\"https://en.wikipedia.org/wiki/Skechers#cite_note-24\">[24]</a></p>', 70, 1, 0, 'Skechers running', 'Best running shoes from skechers', 'skechers running, run in a different way, beautiful running schoes', '2021-12-08 12:16:32', '2021-12-15 14:41:07'),
(9, 'adidas_m41F', 'Adidas', 'If you want you can', 'Adidas_1639584937.png', '<h3>Adidas for running</h3>\r\n\r\n<p>Best shoes and equipement for running</p>\r\n\r\n<p>Adidas, in full Adidas AG, <strong>German manufacturer of athletic shoes and apparel and sporting goods</strong>. In the early 21st century it was the largest sportswear manufacturer in Europe and the second largest (after Nike) in the world. ... Headquarters are in Herzogenaurach, Germany.</p>\r\n\r\n<p>The adidas brand has a long history and deep-rooted connection with sport. Its broad and diverse portfolio in both the Sport Performance and Sport Inspired categories ranges from major global sports to regional grassroot events &nbsp;and local sneaker culture. This has enabled adidas to transcend cultures and become one of the most recognized, credible, and iconic brands both on and off the field of play.</p>\r\n\r\n<h3>Our mission</h3>\r\n\r\n<p>Athletes do not settle for average. And neither do we. We have a clear mission: To be the best sports brand in the world. Every day, we come to work to create and sell the best sports products in the world, and to offer the best service and consumer experience &ndash; and to do it all in a sustainable way. We are the best when we are the credible, inclusive, and sustainable leader in our industry.</p>\r\n\r\n<h3>Our atitude</h3>\r\n\r\n<p>At adidas, we are rebellious optimists driven by action, with a desire to shape a better future together. We see the world of sport and culture with possibility where others only see the impossible. &lsquo;Impossible is Nothing&rsquo; is not a tagline for us. By being optimistic and knowing the power of sport, we see endless possibilities to apply this power and push all people forward with action.</p>', 20, 1, 0, 'adidas ruuning equipment', 'adidas for childs, mens and womans', 'adidas, shoes, clothes, accesories, best price, beautiful shoes', '2021-12-11 13:18:47', '2021-12-19 13:22:20');
INSERT INTO `categories` (`id`, `section_id`, `slug`, `name`, `title`, `description`, `photo`, `icon`, `position`, `active`, `promo`, `meta_title`, `meta_description`, `meta_keywords`, `created_at`, `updated_at`) VALUES
(1, 1, 'neutral-running-shoes_FBle', 'Neutral Running Shoes', 'Shoes for every day running on the road', '<h2>Upgrade Your Collection With Neutral Running Shoes</h2>\r\n\r\n<p>No matter what the time or place it, now you can run without any trouble with the right set of running shoes by your side. There are different types of runners all over the world. Some would like to run on the track with a predefined path in order to develop a pattern, while the other lot would like to run in the wild, in an uneven or fortified path in order to really experience their jogging session to its best. It doesn&rsquo;t matter what kind of runner you are, but with these neutral running shoes, you are bound to fulfil every requirement of yours.</p>\r\n\r\n<p>There is a reason why these shoes are so much in demand. They let a runner jog in every kind of condition, without any trouble. Neutral shoes are also extremely lightweight in nature and let a runner attain just the right balance they want. They are preferred by thousands of fitness enthusiasts out there, as they are fit not only to be taken on the track or in the wild, but you can also hit the gym while wearing these amazing shoes.</p>', 'NeutralRunningShoes_1637584328.jpg', NULL, 20, 1, 0, 'Neutral running shoes', 'Neutral running shoes', 'Neutral running shoes', '2021-10-27 11:35:56', '2021-11-29 13:00:34'),
(2, 1, 'fitness-shoes_NbQC', 'Fitness shoes', 'Shoes for gym and fitness exercises', '<h2>Buy Your Next Pair Of Fitness Shoes From Us</h2>\r\n\r\n<p>Every runner is particular about the way they jog. There are plenty of fitness enthusiasts out there who prefers nothing else than a good and comfortable pair of fitness shoes to accompany them during their running sessions. These shoes are not only durable in nature, but are also composed of lightweight materials that enable the runner to have a flawless leg movement. If you are buying a new pair of shoes for the purpose of walking or jogging, then we must recommend one of these shoes. They will certainly let you warm up to your fitness regime and you can easily hit the gym in style while wearing these.</p>\r\n\r\n<p>It is the overall composition and design of these training shoes that sets them apart from their counterparts. They have an uneven sole which is designed in such a way that it would optimize the effort and energy of a runner. Since it has an uneven sole, it will make sure that heel region is dropped at a lower stage that the rest of the foot. This will help you maintain a better synchronization while running and you would attain a flawless composition without any trouble. The composition guarantees to put you at ease while letting you stay comfortable during those long strolls.</p>', 'Fitnessshoes_1637589800.jpg', NULL, 40, 1, 0, 'Fitness shoes', 'Fitness shoes for gym exercises and fitness', 'fitness shoes, gym exercises, street training', '2021-10-27 11:35:56', '2021-11-22 12:03:20'),
(4, 1, 'competition-shoes', 'Competition shoes', 'Shoes for running competions or very fast runnings', '<h2>Running shoes for experienced runners</h2>\r\n\r\n<h3>Fast light running shoes</h3>\r\n\r\n<p>Every fitness enthusiast and runner knows that in order to get better, they need to beat their own record. When it comes to running, your biggest competitor is yourself and in order to bring an edge to the way you jog, you need the support of some of the best running shoes out there. In order to let our customers experience a great time shopping with us, we have handpicked some of the best competition shoes from a range of various brands like Asics, Li-Ning, Puma, Nike, Adidas, and a lot more. One can see how we have collected such a diverse range of brands, letting our customers have no excuse to buy their favourite products.</p>\r\n\r\n<p>This is one of the main reasons why Jogging-Point is such a reputed name in the industry. We are one of the most recommended online stores to buy running products as we have a diverse range that is presented in an easy to navigate manner. We have provided various filters so that our customers can pick the product they like the most of the basis of their gender, colour choice, size, the ongoing promotion, the preferred brand, and a lot more.</p>', 'Competitionshoes_1637582432.jpg', NULL, 10, 1, 0, 'Competition shoes', 'Competition shoes', 'Competition shoes', '2021-10-27 11:35:56', '2021-12-20 13:14:26'),
(6, 1, 'trail-shoes_BiY5', 'Trail shoes', 'Trail shoes for running on field, trails, mountain', '<h2>Get A Perfect Pair Of Trail Running Shoes</h2>\r\n\r\n<p>If you would like to run on the grass, terrains, or outdoors, then you certainly can&rsquo;t ask for a better pair. Trail running shoes are specially engineered for those who would like to run outdoors and on softer surfaces. You might be wondering what makes these shoes so different form their counterparts. One of the major characteristics which set these shoes apart is their design. These shoes are comparatively less cushioned than other kinds of shoes, letting you run without any trouble on softer surfaces.</p>\r\n\r\n<p>Trail shoes are composed in such a way that they produce a great amount of friction. As while running on the grass, one of the major difficulties comes regarding friction. Theses shoes will make sure that you won&rsquo;t slip or face any other kind of fatal injury while running. Also, they have a lower ground and a smaller heel, which makes it easier for runners to jog on terrains without facing any difficulty.</p>', 'Trailshoes_1637588662.jpg', NULL, 30, 1, 0, 'Trail shoes', 'Trail shoes to run on trail and soft surfaces', 'shoes for trails, mountain, wood and soft surfaces', '2021-10-27 11:35:56', '2021-11-22 11:44:22'),
(8, 2, 'running-shorts_s9J2', 'Running shorts', 'Running short for cool and warm weather', '<h2>Running shorts for race and fast trainning sessions</h2>\r\n\r\n<p>With the assistance of these remarkable running clothing products, you are sure to outshine everyone on the running tracks. It doesn&rsquo;t matter if you are preparing for a competition or if you like to jog to stay fit, with the help of these branded items, you will certainly feel a difference. You would stay more focussed and at ease for hours, so that you can level up the efficiency of your fitness regime.</p>\r\n\r\n<p>If you are inspired by professional runners like Henry Rono, David Moorcroft, Deena Kastor, Irina Mikitenko, Lemi Hayle, and more, then you should definitely do something unique and inspiring as well. With these durable running clothes, you can surely make your dreams come true. They will come handy to you on different occasions and will keep being your companion during those long running sessions for the days to come. Just include the ones you like the most to your cart and complete your purchase.</p>', 'Runningshorts_1637916520.jpg', NULL, 30, 1, 0, 'running shorts', 'running shorts for competion and fast training session', 'running shorts, fast trainings, competition, race running', '2021-10-27 11:35:56', '2021-11-26 06:48:40'),
(9, 2, 'running-pants-qyv3_S3Jq', 'Running pants', 'Shorts and pants for running on every wheater', '<h2>Running pants for cold and warm wheather</h2>\r\n\r\n<p>Each runner has individual needs; therefore we want to provide you with a couple of hints to help you find your perfect running outfit.</p>\r\n\r\n<p><em>It is really important to measure correctly. </em></p>\r\n\r\n<p>Here a couple of rules on how to measure your sizes:</p>\r\n\r\n<p>Hold the measuring tape close but not too tight around the to-be measured part of the body. If you measure yourself alone, try to measure each part a couple of times and take the average of the measurements. Otherwise ask someone for help. Keep in mind that children keep growing so you might have to measure more frequently.</p>', 'Runningpants_1637610527.jpg', NULL, 10, 1, 0, 'Running pants', 'Running pants', 'Running pants', '2021-10-27 11:35:56', '2021-11-22 17:48:47'),
(12, 2, 'running-socks_qsa1', 'Running socks', 'Running socks for confort racing and trainning', '<h2>Running socks for training and competitions</h2>\r\n\r\n<p>Runners obsess over every detail of a <a href=\"https://www.runnersworld.com/gear/a19663621/best-running-shoes/\">running shoe</a> to make sure they have comfort dialed for every step. But many of us will still jam an old cotton sock between that pricey shoe and our foot. The humble sock, however, plays an important role in keeping you dry and warm (or cool).</p>\r\n\r\n<h3>Materials Matter</h3>\r\n\r\n<p>First off, avoid cotton at all costs. Sure, you could safely make it through a 3-mile recovery run in a pair that came from a 12-pack, but on hot or wet days you&rsquo;ll find cotton absorbs an incredible amount of water and easily <a href=\"https://www.runnersworld.com/health-injuries/a19574724/blister-treatment-and-prevention/\">causes blisters</a>. Merino wool, on the other hand, is a fiber you can wear year-round thanks to its ability to regulate temperature, move moisture, and <a href=\"https://www.runnersworld.com/gear/a20859367/how-to-get-rid-of-smelly-shoes/\">resist odors</a>. You&rsquo;ll find it used in many pairs of <a href=\"https://www.runnersworld.com/gear/a20863096/best-compression-socks/\">performance socks</a>. Most, however, use a mix of synthetic fabrics&mdash;nylon, polyester, and spandex&mdash;which offers good value and durability, plus prevents irritation.</p>', 'Runningsocks_1637917209.jpg', NULL, 40, 1, 0, 'running socks', 'running socks for confortable running', 'running socks, competion socks, warm socks', '2021-10-27 11:35:56', '2021-11-26 07:00:09'),
